-- If using https://www.mycompiler.io/new/mysql, please paste and run all queries from Q1.sql to Q5.sql in the same editor/session

CREATE TABLE `employee` (
    `id` INT NOT NULL,
    `name` VARCHAR(255) NOT NULL,
    `phone_number` VARCHAR(15) NOT NULL,
    `email_id` VARCHAR(255) DEFAULT NULL,
    `office_number` INT NOT NULL,
    `floor_number` INT NOT NULL,

    PRIMARY KEY (`id`)
);

CREATE TABLE `meeting_room` (
    `id` INT NOT NULL,
    `floor_number` INT NOT NULL,

    PRIMARY KEY (`id`)
);

CREATE TABLE `meeting` (
    `id` INT NOT NULL,
    `meeting_room_id` INT NOT NULL,
    `start_time` DATETIME NOT NULL,
    `end_time` DATETIME NOT NULL,
    `start_hour` INT NOT NULL,
    `end_hour` INT NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`meeting_room_id`) REFERENCES `meeting_room`(`id`)
);

CREATE TABLE `employee_meeting` (
    `employee_id` INT NOT NULL,
    `meeting_id` INT NOT NULL,

    PRIMARY KEY (`employee_id`, `meeting_id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`),
    FOREIGN KEY (`meeting_id`) REFERENCES `meeting`(`id`)
);

CREATE TABLE `test` (
    `id` INT NOT NULL,
    `location` VARCHAR(255) NOT NULL,
    `tested_at` DATETIME NOT NULL,
    `employee_id` INT NOT NULL,
    `result` ENUM('NEGATIVE', 'POSITIVE') NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`)
);

CREATE TABLE `notification` (
    `id` INT NOT NULL,
    `employee_id` INT NOT NULL,
    `test_id` INT NOT NULL,
    `sent_at` DATETIME NOT NULL,
    `type` ENUM('MANDATORY', 'OPTIONAL') NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`),
    FOREIGN KEY (`test_id`) REFERENCES `test`(`id`)
);

CREATE TABLE `scan` (
    `id` INT NOT NULL,
    `scanned_at` DATETIME NOT NULL,
    `employee_id` INT NOT NULL,
    `temperature` DECIMAL(5,2) NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`)
);

CREATE TABLE `symptom` (
    `id` INT NOT NULL,
    `employee_id` INT NOT NULL,
    `reported_at` DATETIME NOT NULL,
    `symptom_id` INT NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`)
);

CREATE TABLE `employee_case` (
    `id` INT NOT NULL,
    `employee_id` INT NOT NULL,
    `date` DATETIME NOT NULL,
    `resolution` enum('SICK', 'LEFT_WORK', 'BACK_TO_WORK', 'DECEASED') NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee` (`id`)
);

CREATE TABLE `health_status` (
    `id` INT NOT NULL,
    `case_id` INT NOT NULL,
    `employee_id` INT NOT NULL,
    `date` DATETIME NOT NULL,
    `status` enum('SICK', 'HOSPITALISED', 'WELL') NOT NULL,

    PRIMARY KEY (`id`),
    FOREIGN KEY (`case_id`) REFERENCES `employee_case`(`id`),
    FOREIGN KEY (`employee_id`) REFERENCES `employee`(`id`)
);

